`,s.jsxs(t.ul,{children:[`
`,s.jsx(t.li,{children:"Post-it notes"}),`
`,s.jsx(t.li,{children:"Pens"}),`
`]}),`
`,s.jsx(t.h2,{children:"Setting the scene"}),`
`,s.jsxs(t.p,{children:["We will now becomes chefs and work together to create a ",s.jsx(t.em,{children:"Sprint pizza"})]}),`
